import Card from './Card'

const CardList = ({ robots }) => {
	const cardsArray = robots.map((user, ind) => {
		return (
			<Card 
				key={ind} 
				id={robots[ind].id} 
				name={robots[ind].name} 
				email={robots[ind].email}
			/>
		);
	})
	return (
		<div>
		{cardsArray}
		</div>
	);
}

export default CardList;
